const items = $input.all();
const supabaseData = [];

for (const item of items) {
  const row = item.json;

  // Ajusta estos campos según la estructura de tu Google Sheet
  const ticketData = {
    id_tickets: parseInt(row['Número Ticket'] || row['A'] || 0),
    nombre: row['Nombre'] || row['B'] || '',
    telefono: row['Teléfono'] || row['C'] || '',
    estado: mapEstadoToSupabase(row['Estado'] || row['D'] || 'disponible'),
    // Agrega más campos según tu estructura
  };

  supabaseData.push(ticketData);
}

// Función para mapear estados
function mapEstadoToSupabase(estado) {
  const estadoLower = (estado || '').toLowerCase();
  if (estadoLower.includes('vendido') || estadoLower.includes('ocupado')) {
    return 'ocupado';
  }
  if (estadoLower.includes('reservado')) {
    return 'reservado';
  }
  return 'disponible';
}

return supabaseData.map(data => ({ json: data }));
